import React, { useEffect, useState } from "react";
import axios from "axios";

const MedicineBookings = () => {
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchBookings = async () => {
    try {
      const response = await axios.post(
        "http://localhost:8000/medical_store_app/payment_details/"
      );
      console.log("API Response:", response);
      if (response.data && Array.isArray(response.data.paymentDetails)) {
        setBookings(
          response.data.paymentDetails.map((booking) => ({
            id: booking.razorpay_order_id || "Unknown",
            amount: booking.amount || "0.00",
            createdAt: booking.created_at || "N/A",
            paymentId: booking.razorpay_payment_id || "N/A",
            signature: booking.razorpay_signature || "N/A",
          }))
        );
      } else {
        console.error("Unexpected response format:", response.data);
        setError("Unexpected response format. Please contact support.");
      }
    } catch (error) {
      console.error("Error fetching bookings:", error);
      setError("Failed to fetch bookings. Please try again later.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchBookings();
  }, []);

  const containerStyle = {
    margin: "0 auto",
    padding: "80px",
    maxWidth: "1200px",
    textAlign: "center",
  };

  const tableStyle = {
    border: "1px solid black",
    width: "100%",
    borderCollapse: "collapse",
    marginTop: "20px", 
  };

  const headerStyle = {
    backgroundColor: "#f2f2f2",
    fontWeight: "bold",
    textAlign: "left",
    border: "1px solid black",
    padding: "8px",
  };

  const cellStyle = {
    border: "1px solid black",
    padding: "8px",
  };

  const emptyRowStyle = {
    textAlign: "center",
    fontStyle: "italic",
    padding: "16px",
  };

  return (
    <div style={containerStyle}>
      <h2>Medicine Bookings</h2>
      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p style={{ color: "red" }}>{error}</p>
      ) : (
        <table style={tableStyle}>
          <thead>
            <tr>
              <th style={headerStyle}>Order ID</th>
              <th style={headerStyle}>Amount</th>
              <th style={headerStyle}>Created At</th>
              <th style={headerStyle}>Payment ID</th>
              <th style={headerStyle}>Signature</th>
            </tr>
          </thead>
          <tbody>
            {bookings.length === 0 ? (
              <tr>
                <td colSpan="5" style={emptyRowStyle}>
                  No bookings found
                </td>
              </tr>
            ) : (
              bookings.map((booking) => (
                <tr key={booking.id}>
                  <td style={cellStyle}>{booking.id}</td>
                  <td style={cellStyle}>{booking.amount}</td>
                  <td style={cellStyle}>{booking.createdAt}</td>
                  <td style={cellStyle}>{booking.paymentId}</td>
                  <td style={cellStyle}>{booking.signature}</td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default MedicineBookings;
